import React from 'react';
import ReactDOM from 'react-dom';

import App from './components/App';

const dealsData = [ { key: 'a', state: 'completed', taskText: 'Completed task'},
                    { key: 'b', state: 'editing', taskText: 'Editing task'},
                    { key: 'c', state: 'active', taskText: 'Active task'}
                  ];

ReactDOM.render(<App dealsData = {dealsData} />, document.getElementById('root'));
